    stringify = require('stringify');

var bundle = browserify()
    .transform(stringify, {
      appliesTo: { includeExtensions: ['.hjs', '.html', '.whatever'] }
    })
    .add('my_app_main.js');

app.use(bundle);

const styleguideIframe = () => (
  <div>
  </div>
);

const Components = () => (
  <div dangerouslySetInnerHTML={template} >
  </div>
);

export default Components;
